import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the History navigation item to be visible and click it
    await page.waitForSelector('.nav-item[data-page="history"]');
    await page.click('.nav-item[data-page="history"]');

    // Take a screenshot after clicking the History item
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_history_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_history_clicked.png'));

    // Verify that the History page is displayed by checking for a specific element
    const historyPageVisible = await page.waitForSelector('h1:has-text("History")', { timeout: 5000 });

    return {
      success: true,
      action: "Clicked on the History navigation menu item to view watch history",
      extractedData: {
        historyPageVisible: !!historyPageVisible
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

